import React, { useEffect, useState } from "react";
import { useNavigate, useParams } from "react-router-dom";
import styled, { keyframes } from "styled-components";
import axios from "axios";
import Header from "../components/Header";

const pageBlue = "#f0f4f8";
const fadeIn = keyframes`from{opacity:0;transform:translateY(10px)} to{opacity:1;transform:translateY(0)}`;
const accent = "#175dff";
const cardBg = "#ffffff";
const cardShadow = "0 4px 12px rgba(0,0,0,0.1)";
const textDark = "#333";

const Wrapper = styled.div`
  background: ${pageBlue};
  min-height: 100vh;
`;
const ContentWrapper = styled.div`
  max-width: 1200px;
  margin: 2rem auto;
  padding: 0 1rem;
  animation: ${fadeIn} .5s ease-out;
`;
const Hero = styled.section`
  text-align: center;
  margin-bottom: 2rem;
`;
const HeroTitle = styled.h1`
  margin: 0;
  font-size: 2.5rem;
  color: ${accent};
`;
const AddSection = styled.div`
  display: flex;
  justify-content: flex-end;
  margin-bottom: 1rem;
`;
const AddButton = styled.button`
  padding: 0.6rem 1.2rem;
  background: ${accent};
  color: #fff;
  border: none;
  border-radius: 6px;
  font-size: 1rem;
  font-weight: 600;
  cursor: pointer;
  &:hover { background: #004bff; }
`;
const Grid = styled.div`
  display: grid;
  gap: 1.5rem;
  grid-template-columns: repeat(auto-fit, minmax(200px, 1fr));
`;
const Card = styled.div`
  background: ${cardBg};
  box-shadow: ${cardShadow};
  border-radius: 10px;
  padding: 1rem;
  display: flex;
  flex-direction: column;
  justify-content: space-between;
  transition: transform .3s;
  &:hover { transform: translateY(-6px); }
`;
const Title = styled.h3`
  margin: 0 0 1rem;
  font-size: 1.2rem;
  color: ${textDark};
  text-align: center;
`;
const BtnGroup = styled.div`
  display: flex;
  justify-content: center;
  gap: 0.5rem;
`;
const Btn = styled.button`
  padding: 0.5rem 1rem;
  background: ${accent};
  color: #fff;
  border: none;
  border-radius: 4px;
  font-size: 0.9rem;
  cursor: pointer;
  &:hover { background: #004bff; }
`;

export default function AdminListingsPage() {
  const { category } = useParams();
  const [items, setItems] = useState([]);
  const navigate = useNavigate();

  useEffect(() => {
    const token = localStorage.getItem("jwt");
    axios.defaults.headers.common["Authorization"] = `Bearer ${token}`;
    axios.get(`/api/listings/${category}`)
      .then(res => setItems(res.data))
      .catch(console.error);
  }, [category]);

  const handleEdit = id => navigate(`/admin/${category}/${id}/edit`);
  const handleDelete = id => {
    const token = localStorage.getItem("jwt");
    axios.delete(`/api/listings/${category}/${id}`, {
      headers: { Authorization: `Bearer ${token}` }
    })
    .then(() => setItems(prev => prev.filter(i => i.id !== id)))
    .catch(console.error);
  };

  return (
    <Wrapper>
      <Header />
      <ContentWrapper>
        <Hero>
          <HeroTitle>Manage {category.charAt(0).toUpperCase() + category.slice(1)}</HeroTitle>
        </Hero>
        <AddSection>
          <AddButton onClick={() => navigate(`/admin/${category}/new`)}>
            + Add New {category.slice(0, -1)}
          </AddButton>
        </AddSection>
        <Grid>
          {items.map(item => (
            <Card key={item.id}>
              <Title>{item.title}</Title>
              <BtnGroup>
                <Btn onClick={() => handleEdit(item.id)}>Edit</Btn>
                <Btn onClick={() => handleDelete(item.id)}>Delete</Btn>
              </BtnGroup>
            </Card>
          ))}
        </Grid>
      </ContentWrapper>
    </Wrapper>
  );
}
